package com.ttpl.asd.drukairagentwebportal.web;

import com.ttpl.asd.drukairagentwebportal.auth.model.User;
import com.ttpl.asd.drukairagentwebportal.auth.service.UserService;
import com.ttpl.asd.drukairagentwebportal.helper.CurrentUser;
import com.ttpl.asd.drukairagentwebportal.helper.ResponseMessage;
import com.ttpl.asd.drukairagentwebportal.service.UserDataService;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.security.core.Authentication;
import org.springframework.stereotype.Controller;
import org.springframework.ui.Model;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RequestMethod;
import org.springframework.web.bind.annotation.ResponseBody;

import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import java.io.IOException;
import java.util.Date;

@Controller
@RequestMapping("/dashboard")
public class DashboardController {
    ResponseMessage responseMessage;

    @Autowired
    private UserService userService;

    @Autowired
    private UserDataService userDataService;

    @RequestMapping("")
    public String index(Model model, HttpServletRequest request, HttpServletResponse response, Authentication authentication)
            throws IOException {
        String agentCode = authentication.getName();

        User user = userService.findByUsername(agentCode);
        CurrentUser currentUser = new CurrentUser();
        currentUser.setAgentName(user.getAgentname());
        request.getSession().setAttribute("currentUser", currentUser);
        if (user.getChangePassword().equals(Boolean.FALSE)) {
            response.sendRedirect("newPassword");
        }
        return "dashboard";
    }

    @ResponseBody
    @RequestMapping(value = "/getCustomerDetails", method = RequestMethod.GET)
    public ResponseMessage getCustomerDetails(HttpServletRequest request, HttpServletResponse response, String agentCode, Date startDate, Date endDate, Integer specialGL,
                                              Authentication authentication) throws Exception {
        String agentCodename = authentication.getName();

//      if(authentication.getPrincipal())
        if (agentCode != null) {
            agentCodename = agentCode;
        }
        ResponseMessage responseMessage = new ResponseMessage();

        responseMessage = userDataService.getCustomerDetails(agentCodename, startDate, endDate, specialGL);
//        String userData = "";
//        UserDataDTO userDataDTO = new UserDataDTO();
//        userDataDTO.setUserData(userData);
//        responseMessage.setDTO(userDataDTO);
//        responseMessage.setStatus(SystemDataInt.MESSAGE_STATUS_SUCCESSFUL.value());
        return responseMessage;
    }
}
